script: |
  super -f text -I q4446.spq | sort > q4446.out

inputs:
  - name: q4446.spq
    data: |
      SELECT ( col0 ) / + 61 + + 62 AS col2 FROM tab2 (FORMAT parquet) WHERE ( + 4 * + 81 / 79 ) NOT BETWEEN col0 - - col2 AND NULL;
  - name: tab2

outputs:
  - name: q4446.out
    data: |
      62
      63
      63
